import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Header from './components/Header';
import Presentation from './components/Presentation';
import Carousel from './components/Carousel'


const App = () => {
  return (
    <div>
      <Switch>

        <Route >
          <Header/>
        </Route>

      </Switch>
      <Presentation/>
      <Carousel />
    </div>
  );
}

export default App;
